var fiveYearsFill = '#ffffff';
var tenYearsFill = '#ffffff';
var yearsStrokeWidth = '1';
var yearsAlpha = 0.4;

var greenlandFill = '#749E3D';
var iceSheetFill = '#F3F6FB';

var mapStrokeColor = '#000000';
var mapStrokeWidth = '1';
var mapStrokeDash = '5, 5';



iceSheet = svg.select('#ice-sheet')
  .attr('transform', 'translate(1158.000000, 2)');

iceSheet.append('g')
    .attr('transform', 'translate(1511.000000, 584.000000)')
  .append('text')
    .attr('font-size', '24')
    .text('Ilulissat');

// greenland
iceSheet.append('path')
  .attr('id', 'greenland-path')
  .attr('d', pathData2)
  .attr('fill', greenlandFill)
  .attr('stroke', mapStrokeColor)
  .attr('stroke-width', mapStrokeWidth);

// ice sheets
iceSheet.append('path')
  .attr('id', 'five-years-path')
  .attr('d', pathData1)
  .attr('fill', fiveYearsFill)
  .attr('stroke', '#ffffff')
  .attr('stroke-width', yearsStrokeWidth)
  .attr('stroke-dasharray', mapStrokeDash)
  .attr('fill-opacity', yearsAlpha);

iceSheet.append('path')
  .attr('id', 'ten-years-path')
  .attr('d', transformPath1)
  .attr('fill', tenYearsFill)
  .attr('stroke', '#ffffff')
  .attr('stroke-width', yearsStrokeWidth)
  .attr('stroke-dasharray', mapStrokeDash)
  .attr('fill-opacity', yearsAlpha);

var iceSheetPath = iceSheet.append('path')
  .attr('id', 'ice-sheet-path')
  .attr('d', pathData1)
  .attr('fill', iceSheetFill)
  .attr('stroke', mapStrokeColor)
  .attr('stroke-width', mapStrokeWidth);

group = iceSheet.append('g')
    .attr('transform', 'translate(1511.000000, 584.000000)');

group.append('text')
    .attr('font-size', '24')
    .text('Ilulissat');

group.append('circle')
  .attr('cx', 92.5)
  .attr('cy', 28.5)
  .attr('r', 3.5);

yearlyPrediction = svg.append('text')
  .attr('transform', 'rotate(-90) translate( -' + (svgHeight/2) + ', ' + (svgWidth - 20) + ')')
  .attr('text-anchor', 'middle')
  .attr('font-size', 30)
  // .attr('alignment-baseline', 'central')
  .text('Ice Sheet Now');


// animations
var transitionTime = 14500;
var staggerTime = 500;

animationFunctions.push(iceSheetAnimation);

function iceSheetAnimation(x) {

  x = x % 30;

  if (x == 0) {
    iceSheetPath
      .transition()
        .duration(staggerTime)
        .attr('d', pathData1)
      .transition()
        .ease(d3.easeLinear)
        .delay(staggerTime)
        .duration(transitionTime)
        .attr('d', transformPath1);
  }

  if (x == 15) {
    iceSheetPath
      .transition()
        .ease(d3.easeLinear)
        .delay(staggerTime)
        .duration(transitionTime)
        .attr('d',  transformPath2);
  }

  timeFrame = Math.floor(x/3);

  yearlyPrediction.text('Ice Sheet' + (timeFrame == 0 ? ' Now' : ' in ' + (timeFrame) + ' Year' + (timeFrame == 1 ? '' : 's')));
};
